import React, { Component } from 'react'

class NewClient extends Component {
    state = {
        users: {
            name: '',
            email: '',
            vehicle: '',
            tireRotation: '',
            oilChange: '',
            wheelAlign: '',
            brakePad: ''
        }
     }

     addUser = (e) => {
         console.log(this.state)
         this.props.addUser(this.state);
     }

    render() {
     
        return(
            <div className="container">
                <div className="col-md-6">
                    <form onSubmit={(e) => this.addUser(e)}>

                        <div className="form-group">
                            <label>Name</label>
                            <input
                                type="text"
                                className="form-control"
                                value={this.state.name}
                                onChange={(e) => this.setState({ name: e.target.value })}
                            />
                        </div>

                        <div className="form-group">
                            <label>Email</label>
                            <input
                                type="text"
                                className="form-control"
                                value={this.state.email}
                                onChange={(e) => this.setState({ email: e.target.value })}
                            />
                        </div>

                        <div className="form-group">
                            <label>Vehicle</label>
                            <input
                                type="text"
                                className="form-control"
                                value={this.state.vehicle}
                                onChange={(e) => this.setState({ vehicle: e.target.value })}
                            />
                        </div>

                        <div className="form-group">
                            <label>Tire Rotation</label>
                            <input
                                type="date"
                                className="form-control"
                                value={this.state.tireRotation}
                                onChange={(e) => this.setState({ tireRotation: e.target.value })}
                            />
                        </div>

                        <div className="form-group">
                            <label>Oil Change</label>
                            <input
                                type="date"
                                className="form-control"
                                value={this.state.oilChange}
                                onChange={(e) => this.setState({ oilChange: e.target.value })}
                            />
                        </div>

                        <div className="form-group">
                            <label>Wheel Alignment</label>
                            <input
                                type="date"
                                className="form-control"
                                value={this.state.wheelAlign}
                                onChange={(e) => this.setState({ wheelAlign: e.target.value })}
                            />
                        </div>

                        <div className="form-group">
                            <label>Brake Pad</label>
                            <input
                                type="date"
                                className="form-control"
                                value={this.state.brakePad}
                                onChange={(e) => this.setState({ brakePad: e.target.value })}
                            />
                        </div>

                        <button type="submit" className="btn btn-primary">Submit</button>

                    </form>
                </div>
            </div>
        )
    }
}

export default NewClient;
